import React from "react";

export class Header extends React.Component {
    render() {
        return <header>
            <nav>
                <ul className="nav-list">
                    <li>women</li>
                    <li>men</li>
                    <li>kids</li>
                </ul>
                <img src="./a-logo.png"></img>
            </nav>
        </header>
    }
}
